import "./App.css";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import Product from "./Product";

function App() {
  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 1024 },
      items: 4
    },
    desktop: {
      breakpoint: { max: 1024, min: 800 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 800, min: 580 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 580, min: 0 },
      items: 1
    }
  };

  const productData = [
    {
      id: 1,
      imageurl:'https://m.media-amazon.com/images/I/51iQq6ZYedL.jpg',
      name:'Don Quixote',
      price:'12.99',
      desc: 'Some of the Description'
    },
    {
      id: 2,
      imageurl:'https://m.media-amazon.com/images/I/51iQq6ZYedL.jpg',
      name:'Don Quixote',
      price:'12.9dasdas9',
      desc: 'Some of the Description'
    },
    {
      id: 3,
      imageurl:'https://m.media-amazon.com/images/I/51iQq6ZYedL.jpg',
      name:'Don Quixote',
      price:'12.99',
      desc: 'Some of the Description'
    },
    {
      id: 4,
      imageurl:'https://m.media-amazon.com/images/I/51iQq6ZYedL.jpg',
      name:'Don Quixote',
      price:'12.99',
      desc: 'Some of the Description'
    },
    {
      id: 5,
      imageurl:'https://m.media-amazon.com/images/I/51iQq6ZYedL.jpg',
      name:'Don Quixote',
      price:'12.99',
      desc: 'Some of the Description'
    },
    {
      id: 5,
      imageurl:'https://m.media-amazon.com/images/I/51iQq6ZYedL.jpg',
      name:'Don Quixote',
      price:'12.99',
      desc: 'Some of the Description'
    }

  ]

  const product = productData.map((item) =>(
    <Product name={item.name} url={item.imageurl} desc={item.desc} price={item.price}/>
  ))

  return (
    <div className="App">
      <Carousel responsive={responsive}>
        {product}
      </Carousel>;
    </div>
  );
}

export default App;
